import './LandingPage.css'
import { Link } from 'react-router-dom'

const LandingPage = () =>  {
    return (
        <>
        <div className="landing_general">
            <div className='LandingPage'>
                <h1>Pi Dogs Henry</h1>
                <div className="landing_button">
                    <Link to={'/HomePage'}>
                         <button>GO</button> 
                    </Link>
                </div>
                {/* <div className="profiles_links"> */}
                {/* </div> */}
            </div>  
                <a href="https://www.linkedin.com/in/mateo-caucino/" target="_blank">
                    <img className="logos" src="https://w7.pngwing.com/pngs/402/997/png-transparent-linkedin-logo-computer-icons-facebook-user-profile-facebook-blue-angle-text.png" alt="LinkedIn"/>
                </a>
                <a href="https://github.com/matecauci15" target="_blank">
                    <img className="logos" src="https://uxwing.com/wp-content/themes/uxwing/download/brands-and-social-media/github-icon.png" alt="GitHub"/>
                </a>
        </div>
        </>
    )
}

export default LandingPage

